import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './MenuPage.css';

const MenuPage = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [isAdmin, setIsAdmin] = useState(false);
  const [currentPlan, setCurrentPlan] = useState(null);
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');
  const handleLogout = () => {
    localStorage.removeItem('access');
    navigate('/');
  };
  const menuItems = [
    {
      id: 1,
      name: 'Basic Plan',
      price: '$10/month',
      plan_type: 'basic',
      features: ['10GB Storage', 'Basic Support', 'Limited Access']
    },
    {
      id: 2,
      name: 'Pro Plan',
      price: '$20/month',
      plan_type: 'pro',
      features: ['50GB Storage', '24/7 Support', 'Full Access']
    },
    {
      id: 3,
      name: 'Enterprise Plan',
      price: '$50/month',
      plan_type: 'enterprise',
      features: ['Unlimited Storage', 'Priority Support', 'Custom Solutions']
    }
  ];

  useEffect(() => {
    // Fetch user data
    fetch('http://localhost:8000/api/user/', {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('access')}`
      }
    })
    .then(res => res.json())
    .then(data => {
      setUser(data);
      setIsAdmin(data.is_staff);
    });

    // Fetch current subscription
    fetch('http://localhost:8000/api/user/subscriptions/', {
      headers: {
        'Authorization': `Bearer ${localStorage.getItem('access')}`
      }
    })
    .then(res => res.json())
    .then(data => {
      setCurrentPlan(data.active?.plan || null);
    });
  }, []);

  const handlePurchase = async (planType) => {
    try {
      const response = await fetch('http://localhost:8000/api/purchase-plan/', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${localStorage.getItem('access')}`
        },
        body: JSON.stringify({ plan: planType })
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.error || 'Failed to purchase plan');
      }

      setSuccess(`Successfully subscribed to ${data.plan}`);
      setCurrentPlan(data.plan);

      // Clear success message after 3 seconds
      setTimeout(() => {
        setSuccess('');
      }, 3000);
    } catch (err) {
      setError(err.message);
    }
  };

  return (
    <div className="menu-container">
      <div className="header">
        <h1>Welcome, {user?.username}</h1>
        <div className="header-buttons">
          <button 
            className="profile-button"
            onClick={() => navigate('/profile')}
          >
            My Profile
          </button>
          {isAdmin && (
            <button 
              className="admin-button"
              onClick={() => navigate('/admin')}
            >
              Admin Dashboard
            </button>
          )}
          <button className="logout-button" onClick={handleLogout}>
            Logout
          </button>
        </div>
      </div>

      {success && <div className="success-message">{success}</div>}
      {error && <div className="error-message">{error}</div>}
      
      {currentPlan && (
        <div className="current-plan-banner">
          Your current plan: {currentPlan}
        </div>
      )}

      <div className="plans-container">
        {menuItems.map(item => (
          <div key={item.id} className="plan-card">
            <h2>{item.name}</h2>
            <div className="price">{item.price}</div>
            <ul className="features-list">
              {item.features.map((feature, index) => (
                <li key={index}>
                  <span className="checkmark">âœ“</span>
                  {feature}
                </li>
              ))}
            </ul>
            <button 
              className={`purchase-button ${currentPlan === item.name ? 'current-plan' : ''}`}
              onClick={() => handlePurchase(item.plan_type)}
              disabled={currentPlan === item.name}
            >
              {currentPlan === item.name ? 'Current Plan' : 'Purchase'}
            </button>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MenuPage;
